import React, { useState } from 'react';
import { FaBars } from 'react-icons/fa';

const CategoryBar = () => {
    const [ isShowing, setMenu ] = useState(false)

    const showAndHideMenu = () => setMenu(isShowing => !isShowing)

    return (
        <div className="categoryBar">
            <ul className="categories">
                <li><FaBars onclick={showAndHideMenu}></FaBars></li>
                <li>한식</li>
                <li>중식</li>
                <li>일식</li>
                <li>양식</li>
                <li>카페 / 디저트</li>
            </ul>
        </div>
    )
}

export default categoryBar;
